import React from 'react'
import { Card, Col } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import { connect } from 'react-redux'

const mapStateToProps = (state) => {
    return{
        getUsersList: state.users.getUsersList[1-10],
        errorUsersList: state.users.errorUsersList
    }
 }

function HomeCp(homeIsi) {
    console.log(homeIsi.getUsersList);
    return (
        <div>
                <Link to={'/detail/' + homeIsi.id}>
                    <Col md={4} xs={6} className="mb-4 mt-4 ml-4">
                        <Card style={{ width: '18rem' }} className="shadow">
                            <Card.Img variant="top" src={"assets/images/nama/" + homeIsi.gambar} />
                            <Card.Body>
                                <Card.Title>{homeIsi.getUsersList.name} </Card.Title>
                                <Card.Text>
                                    {homeIsi.username}
                                </Card.Text>
                            </Card.Body>
                        </Card>
                    </Col>
                </Link>
        </div>
    )
}

export default connect(mapStateToProps)(HomeCp);
